  (*!* Test fÅr mehrdimensionale Open Arrays!*)  (*$C-*) module t2;  FROM SYSTEM IMPORT ASSEMBLER, byte, word, longword; var lc: LONGCARD; w: word; c: CARDINAL;   type t1 = record                (* 4 Byte *),w: CARDINAL;,b: char*END; %t2 = array [1..4] of t1;   (* 4*4 Byte *)%String = array [0..5] of char;  PROCEDURE p0 (a: longarray of byte);"BEGIN$ASSEMBLER BREAK END;"END p0;  PROCEDURE p2 (a: array of array of word);"BEGIN$ASSEMBLER BREAK END;$(*$R+*)$p0 (a);$(*$p2 (a);$w:= a[c*(c+c*(c+c*c)),c*(c+c*(c+c*c)),c*(c+c*(c+c*c)),c*(c+c*(c+c*c))];$ASSEMBLER BREAK END;$c:= high (a);$lc:= high (a[0]);$c:= high (a[0,0]);$*)$ASSEMBLER BREAK END;"END p2;  var l: LONGCARD;$a1: t2;$s1: array [0..0] of array [0..1] of array [0..2] of String;  begin"ASSEMBLER BREAK END;"p2(s1[0]); (* HIGH: 1/2/2 *)"(*"ASSEMBLER BREAK END;"p (a1);"*) end t2. 
